import React from 'react'
import Square from "./Square";

export default class Board extends React.Component {
    renderSquare(i) {
        return <Square value={i}/>
    }

    render() {
        const status = 'Next Player: X';

        return (
            <React.Fragment>
                <div className="status">
                    {status}
                </div>
                <div className="board-row">
                    {this.renderSquare(0)}
                    {this.renderSquare(1)}
                    {this.renderSquare(2)}
                </div>
                <div className="board-row">
                    {this.renderSquare(4)}
                    {this.renderSquare(5)}
                    {this.renderSquare(6)}
                </div>
                <div className="board-row">
                    {this.renderSquare(7)}
                    {this.renderSquare(8)}
                    {this.renderSquare(9)}
                </div>
            </React.Fragment>
        )
    }
}
